<script setup>import { ref, onMounted, onBeforeUnmount } from 'vue'
import L from 'leaflet'
import 'leaflet/dist/leaflet.css'

let map
const cidadeSelecionada = ref(null) 
const mapaAtual = ref('original') 
const mostrarmapa = ref(true)     

function mudarMapa(tipo) {
  mapaAtual.value = tipo

  setTimeout(() => {
    if (map) {
      map.invalidateSize()
    }
  }, 100)
}
function abrirCidade(nome, info) {
  cidadeSelecionada.value = { nome, info }
 
}


function fecharCidade() {
  cidadeSelecionada.value = null

  setTimeout(() => { map.invalidateSize() }, 100)
}

onMounted(() => {

  // 1. Definições da Imagem
  const width = 2593
  const height = 1589
  
  // Define os limites da imagem [[y1, x1], [y2, x2]]
  // Adicionei uma pequena margem (pad) manual se quiser, mas o exato funciona bem
  const imageBounds = [[0, 0], [height, width]];
  map = L.map('map', {
    crs: L.CRS.Simple,
    minZoom: 0,
    center: [1294, 1296],
    zoom: 0,
    maxZoom: 0.8,
    zoomSnap: 0.5,
    zoomControl: true,
    maxBounds: imageBounds,
   scrollWheelZoom: false,
    maxBoundsViscosity: 1.0
  })
  
  const bounds = [[0, 0], [height, width]]

  map.fitBounds(bounds)

  const svgElement = document.querySelector('.mapa-svg')

  // --- CORREÇÃO PRINCIPAL AQUI ---
  L.svgOverlay(svgElement, bounds, {
    interactive: true // ISSO PRECISA SER TRUE
  }).addTo(map)

  window.addEventListener('resize', handleResize)
  const coordenadasIniciais = [994, 2296]; // O centro do seu mapa (Y, X)
const zoomInicial = 1;

map.setView(coordenadasIniciais, zoomInicial);
})

function handleResize() {
  map && map.invalidateSize()
}

onBeforeUnmount(() => {
  window.removeEventListener('resize', handleResize)
  map && map.remove()
})
</script>

<style scoped>
.map-container {
  width: 100%;
  height: 100vh;
  position:relative;
}

.mapa-svg .overlay {
  pointer-events: none !important; 
}

.mapa-svg {
  position: absolute;
  width: 0;
  height: 0;
  overflow: hidden;
}

.map-container {
  height: 600px;
  
  width: 100%;
}

.cidade_evento {
  pointer-events: all;
  cursor: pointer;
  transition: fill 0.3s, fill-opacity 0.3s;
  fill: #002e69;
}

.cidade_evento:hover {
  fill: #1a73e8 !important; 
  fill-opacity: 1 !important;
}.cidade_evento {
  pointer-events: auto !important; 
  cursor: pointer;
  transition: fill 0.2s ease;
}


.painel-detalhes {
  padding: 2rem;
  background: white;
  height: 100vh;
  width: 100%;
}/* Container principal do painel */
.painel-detalhes {
  position: absolute; /* Flutua sobre o mapa */
  
  /* Centralização perfeita */
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%); 
  
  /* Tamanho aumentado */
  width: 700px;  /* Aumentei para 700px (ajuste conforme necessário) */
  max-width: 90%; /* Garante que não sai do ecrã em telemóveis */
  max-height: 45vh; /* Altura máxima */
  
  background-color: #ffffff;
  border-radius: 16px; /* Bordas um pouco mais arredondadas */
  box-shadow: 0 10px 40px rgba(0, 0, 0, 0.2); /* Sombra mais forte para destaque */
  padding: 32px; /* Mais espaçamento interno */
  
  z-index: 1000; 
  overflow-y: auto;
  
  /* Nova animação de entrada (surge do centro) */
  animation: popIn 0.3s cubic-bezier(0.18, 0.89, 0.32, 1.28);
}

/* Título */
.painel-detalhes h1 {
  margin-top: 0;
  font-size: 2rem; /* Título maior */
  color: #1a237e;
  border-bottom: 2px solid #e3f2fd;
  padding-bottom: 15px;
  text-align: center; /* Título centralizado fica melhor neste formato */
}

/* Texto */
.painel-detalhes p {
  color: #455a64;
  line-height: 1.8; /* Leitura mais confortável */
  font-size: 1.1rem;
  text-align: justify;
  margin-bottom: 30px;
}

/* Botão */
.btn-voltar {
  display: block;
  width: 50%; /* Botão mais contido, não ocupa tudo */
  margin: 0 auto; /* Centraliza o botão */
  padding: 14px;
  background-color: #2196F3;
  color: white;
  border: none;
  border-radius: 30px; /* Botão arredondado */
  font-size: 1rem;
  font-weight: bold;
  cursor: pointer;
  transition: all 0.2s;
  box-shadow: 0 4px 15px rgba(33, 150, 243, 0.3);
}

.btn-voltar:hover {
  background-color: #1976D2;
  transform: translateY(-2px);
  box-shadow: 0 6px 20px rgba(33, 150, 243, 0.4);
}

/* Animação Pop-In (Elasticidade suave) */
@keyframes popIn {
  from {
    opacity: 0;
    transform: translate(-50%, -50%) scale(0.8);
  }
  to {
    opacity: 1;
    transform: translate(-50%, -50%) scale(1);
  }
}

/* Responsividade: Em telemóveis ocupa quase tudo */
@media (max-width: 768px) {
  .painel-detalhes {
    width: 95%;
    padding: 20px;
  }
  
  .painel-detalhes h1 {
    font-size: 1.5rem;
  }
  
  .btn-voltar {
    width: 100%; /* No telemóvel volta a ocupar a largura toda para facilitar o toque */
  }
}
.container-geral{
  position: relative;
  top: 2rem;
  display: flex;
  flex-direction: column;
  gap: 1rem;
